import React, {Component} from 'react'
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem,
    Button,
  //   NavbarText
  } from 'reactstrap';
import Streamers from '../components/Streamers'
import Clips from '../components/Clips'
import Ranking from '../components/Ranking'
import FeedTextBox from '../components/FeedTextBox'


class Inicio extends React.Component {

    render(){
        const local = localStorage.getItem('logueado')
    return (
        <div className="row">
            {local ?
                <div className="col-12 col-sm-12 col-md-3 justify-content-start">
                <Streamers />
                </div>
                :
                <div className="col-12 col-sm-12 col-md-6 justify-content-start">
                Porfavor, iniciar sesion.
                </div>
                }
        </div>
    )
}

}
export default Inicio
